import React from 'react';


function LoginPage() {

    const handleLogin = () => {
    alert('Login button clicked!');
  };

  const handleForgotPassword = () => {
    alert('Forgot password clicked!');
  };

  const handleCreateAccount = () => {
    alert('Create account clicked!');
  };

  const handleHomeIcon = () => {
    navigate('/Main');
  };

  const handleBarsIcon = () => {
    alert('Bars icon clicked!');
  };

  return (
    <div style={styles.loginContainer}>
      {/* Group 2 */}
      <div style={styles.group2}>
        {/* Rectangle 5 */}
        <div style={styles.rectangle5}></div>

        {/* Group 3 */}
        <div style={styles.group3}>
          {/* username */}
          <div style={styles.username}>
            <div style={styles.rectangle6}></div>
            <input
              type="text"
              placeholder="username"
              style={styles.usernameInput}
            />
          </div>

          {/* password */}
          <div style={styles.password}>
            <div style={styles.rectangle7}></div>
            <input
              type="password"
              placeholder="password"
              style={styles.passwordInput}
            />
          </div>

          {/* LOG IN */}
          <div style={styles.loginButton} onClick={handleLogin}>
            <div style={styles.rectangle8}></div>
            <div style={styles.loginText}>LOG IN</div>
          </div>
        </div>

        {/* Group 4 */}
        <div style={styles.group4}>
          <div style={styles.forgotPassword} onClick={handleForgotPassword}>
            Forgot password?
          </div>
        </div>

        {/* Group 5 */}
        <div style={styles.group5}>
          <div style={styles.noAccount}>No account?</div>
          <div style={styles.createOne} onClick={handleCreateAccount}>
            Create one
          </div>
        </div>
      </div>

      {/* home */}
      <div style={styles.homeIcon} onClick={handleHomeIcon}></div>

      {/* bars */}
      <div style={styles.bars} onClick={handleBarsIcon}>
        <div style={styles.vector}></div>
      </div>
    </div>
  );
}


const styles = {
    loginContainer: {
      position: 'relative',
      width: '100%',
      height: '100vh',
      backgroundColor: '#FFFFFF',
    },
    group2: {
      position: 'absolute',
      width: '700px',
      height: '500px',
      left: '50%',
      top: '50%',
      transform: 'translate(-50%, -50%)',
    },
    rectangle5: {
      position: 'absolute',
      width: '100%',
      height: '100%',
      background: 'linear-gradient(180deg, #D9D9D9 0%, #737373 100%)',
      borderRadius: '20px',
    },
    group3: {
      position: 'absolute',
      width: '80%',
      height: '200px',
      left: '8%',
      top: '10%',
    },
    loginButton: {
      position: 'absolute',
      width: '150px',
      height: '50px',
      left: '50%',
      top: '110%',
      transform: 'translateX(-50%)',
      cursor: 'pointer', 
    },
    rectangle8: {
      position: 'absolute',
      width: '100%',
      height: '100%',
      backgroundColor: '#237ED7',
      borderRadius: '10px',
    },
    loginText: {
      position: 'absolute',
      width: '100%',
      height: '100%',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      fontFamily: 'Inter',
      fontStyle: 'normal',
      fontWeight: 800,
      fontSize: '24px',
      color: '#FFFFFF',
    },
    password: {
      position: 'absolute',
      width: '100%',
      height: '50px',
      left: '0',
      top: '65%',
    },
    rectangle7: {
      position: 'absolute',
      width: '100%',
      height: '100%',
      backgroundColor: '#FFFFFF',
      borderRadius: '10px',
    },
    passwordInput: {
      position: 'absolute',
      width: '100%',
      height: '100%',
      border: 'none',
      borderRadius: '10px',
      paddingLeft: '30px',
      fontFamily: 'Inspiration',
      fontStyle: 'normal',
      fontWeight: 400,
      fontSize: '22px',
      color: '#999999',
      outline: 'none', 
    },
    username: {
      position: 'absolute',
      width: '100%',
      height: '50px',
      left: '0',
      top: '30%',
    },
    rectangle6: {
      position: 'absolute',
      width: '100%',
      height: '100%',
      backgroundColor: '#FFFFFF',
      borderRadius: '10px',
    },
    usernameInput: {
      position: 'absolute',
      width: '100%',
      height: '100%',
      border: 'none',
      borderRadius: '10px',
      paddingLeft: '30px',
      fontFamily: 'Inspiration',
      fontStyle: 'normal',
      fontWeight: 400,
      fontSize: '22px',
      color: '#999999',
      outline: 'none', 
    },
    group4: {
      position: 'absolute',
      width: '100%',
      height: '30px',
      left: '0',
      top: '70%',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
    },
    forgotPassword: {
      fontFamily: 'Inter',
      fontStyle: 'italic',
      fontWeight: 800,
      fontSize: '25px',
      color: '#237ED7',
      cursor: 'pointer', 
    },
    group5: {
      position: 'absolute',
      width: '100%',
      height: '30px',
      left: '0',
      top: '78%',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
    },
    noAccount: {
      fontFamily: 'Inter',
      fontStyle: 'italic',
      fontWeight: 800,
      fontSize: '25px',
      color: '#FFFFFF',
    },
    createOne: {
      fontFamily: 'Inter',
      fontStyle: 'italic',
      fontWeight: 800,
      fontSize: '25px',
      color: '#237ED7',
      marginLeft: '5px',
      cursor: 'pointer', 
    },
    homeIcon: {
      position: 'absolute',
      width: '50px',
      height: '50px',
      left: '20px',
      top: '20px',
      background: `url(${process.env.PUBLIC_URL}/home-icon.png)`,
      backgroundSize: 'cover',
      cursor: 'pointer',
    },
    bars: {
      position: 'absolute',
      width: '30px',
      height: '30px',
      right: '20px',
      top: '20px',
      background: `url(${process.env.PUBLIC_URL}/bars-icon.png)`,
      backgroundSize: 'cover',
      cursor: 'pointer',
      border: 'none',
    },
    vector: {
      position: 'absolute',
      width: '100%',
      height: '100%',
      border: '1.5px solid #2C2C5D',
    },
  };


export default LoginPage;
